(1029, 197, 'en', '<p class=\"p1\"><em><span class=\"s1\">Welcome to the site of the Hathor Dentistry Clinic, a team of dentists located in the City of Niterói in Rio de Janeiro – Brazil.</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">We take care of patients from 13+ years old, always with specialized professionals. To achieve excellent results, we are always in congresses and courses to keep up with scientific advances in dentistry. In addition, we are frequently ministering courses and conferences at national and international dental congresses.</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">We have a team of 10 dentists, where 07 of us are teachers of university or postgraduate courses. The other three have at least two specializations in Dentistry. We have in our team, professionals who speak Portuguese, English and / or Spanish, which facilitates the reception and care of foreign patients.</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">We are happy today, the Hathor Clinic is recognized as one of the biggest references in Brazilian dentistry, receiving patients from all over the world. It is through transparency in the presentation of solutions for each case that we establish a bond of trust necessary for the effective and efficient realization of our work.</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">We offer a wide variety of dental services to meet the specific needs of each patient. We believe that the use of technology can improve the experience and results of treatments. We are dedicated to providing the highest level of treatment in a timely, friendly and comfortable way.</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Professional teeth cleaning</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Teeth whitening</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Cosmetic dentistry (Inlays and Onlays, Porcelain veneers, Crowns and dental bridges, composite bonding)</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Dental implants</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Complete dentures (fixed and removable)</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Removable partial dentures</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Orthodontic treatment</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Root canals</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Dental extractions</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">– Small surgeries</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">This site was designed to help patients better understand what our dental team can provide and to understand the importance of receiving regular dental care.</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">Feel free to browse through the site to meet the team members and see some of the services we offer. (the other pages will be available only in Portuguese).</span></em></p>\r\n<p class=\"p1\"><em><span class=\"s1\">Thank you for visiting our site. We hope to meet all your dental needs. If you have any questions or wish to schedule an appointment, call the office at +55 21 2610-3933 or +55 21 99943-1627.</span></em></p>'),
