(140, 1, '2020-06-10 03:13:16', '2020-06-10 03:13:16', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque vitae luctus lorem, quis convallis nisi. Vivamus tempor dignissim est, at pharetra purus ornare nec. Pellentesque in mauris a mauris convallis viverra. Aenean facilisis lobortis ipsum ut eleifend. Donec nec tincidunt tellus. Cras congue ac metus et lacinia. Fusce tempor et est eget gravida. Integer turpis diam, condimentum quis venenatis sit amet, gravida eu arcu. Aliquam ac dui nec dui accumsan hendrerit. Vivamus neque dui, elementum id tellus vel, tempus condimentum purus. Cras nec suscipit diam, sit amet rutrum sapien. Praesent vel venenatis dolor, sed dapibus leo. In nec sapien rhoncus, pulvinar metus sed, sagittis velit. Praesent nec tortor in nisl consequat pretium et nec leo. Quisque fermentum laoreet lectus a eleifend. Morbi vestibulum non risus sed cursus.', 'Lorem ipsum dolor sit amet', '', 'publish', 'closed', 'closed', '', 'lorem-ipsum-dolor-sit-amet', '', '', '2020-06-10 03:13:56', '2020-06-10 03:13:56', '', 0, 'http://localhost/_CAQO/clinicathor/?post_type=portfolio&#038;p=140', 1, 'portfolio', '', 0),
