(142, 1, '2020-06-10 03:20:02', '2020-06-10 03:20:02', 'Muitas pessoas perguntam porque ir ao dentista para revisão periódica?\r\n\r\n&nbsp;\r\n\r\n<em>“Faço uma boa higienização com escovação dos dentes e língua, uso fio dental e anti-séptico bucal, e não tem nada doendo! Mesmo assim preciso ir ao dentista?”</em>\r\n\r\n&nbsp;\r\n\r\nA conduta ideal é uma visita preventiva ao dentista para uma revisão, a cada seis meses, veja porque:\r\n\r\n&nbsp;\r\n<ol>\r\n 	<li>Na consulta preventiva, o profissional da odontologia irá examinar toda a cavidade bucal realizando uma revisão em dentes, gengiva, língua e mucosas da boca.</li>\r\n 	<li>Em seis meses, uma cárie pode ter se formado na estrutura superficial do dente, e ser restaurada em menos tempo e a um custo mais baixo, sem grande destruição dos dentes. Uma cárie que permanece no dente por muito tempo, para ser removida provocará um desgaste maior do dente.</li>\r\n 	<li>Sem o tratamento, a cárie pode atingir a polpa (que é o nervo do dente) causando inflamação, e provavelmente um tratamento de canal.</li>\r\n 	<li>Muitas alterações não são facilmente identificadas em casa, como restaurações mal adaptadas, infiltrações, cáries entre os dentes, etc.</li>\r\n 	<li>No exame periódico, o dentista também avaliará sua lingua, mucosa da boca, lábios e outras regiões a fim de localizar qualquer lesão, prevenindo o câncer de boca.</li>\r\n</ol>\r\n<h2></h2>\r\n<h2 style=\"text-align: center;\">\"Prevenção: Controle e revisão periódica\"</h2>\r\n&nbsp;\r\n\r\n<img class=\"aligncenter wp-image-1376 size-full\" src=\"https://www.clinicahathor.com.br/wp-content/uploads/dental-hypnosis-image1.png\" alt=\"revisão dentista 2\" width=\"300\" height=\"200\" />\r\n\r\n&nbsp;\r\n\r\nA maioria das pessoas devem marcar consultas de controle e revisão periódicos a cada seis meses. Na consulta periódica, o dentista provavelmente realizará algumas radiografias dos seus dentes, ou se necessário, ele pode solicitar a realização de exames de imagem (radiografias, tomografias) em clínicas especializadas para um diagnóstico mais preciso.\r\n\r\n&nbsp;\r\n\r\nCaso não haja nenhum problema, é conveniente fazer uma profilaxia. Isso dificulta o acúmulo de tártaro e formação de cáries.', 'Revisao periódica', '', 'publish', 'closed', 'closed', '', 'revisao-periodica', '', '', '2020-06-10 03:20:02', '2020-06-10 03:20:02', '', 0, 'http://localhost/_CAQO/clinicathor/?post_type=tratamentos&#038;p=142', 1, 'tratamentos', '', 0),
