(197, 1, '2020-06-11 00:11:35', '2020-06-11 00:11:35', '<p class=\"p1\"><span class=\"s1\"><i>Bienvenido al sitio de la Clínica Hathor Odontología, un equipo de dentistas ubicado en la Ciudad de Niterói, en Rio de Janeiro, Brasil.</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>Cuidamos de todos los pacientes a partir de 13 años de edad, siempre con profesionales especializados. Para lograr excelentes resultados, siempre estamos en congresos y cursos para mantenernos al día con los avances científicos en el campo de la Odontología. Además, estamos frecuentemente ministramos cursos y conferencias en congresos nacionales e internacionales de Odontología.</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>Tenemos un equipo con 10 dentistas, donde 07 de nosotros somos profesores de cursos universitarios o de postgrado. Los otros tres tienen al menos dos especializaciones en Odontología. Tenemos en nuestro equipo, profesionales que hablan portugués, inglés y / o español, lo que facilita la recepción y el cuidado de los pacientes extranjeros.</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>Estamos felices pues, la Clínica Hathor ya es reconocida como una de las mayores referencias de la Odontología brasileña, recebemos pacientes de todo el mundo. Es a través de la transparencia en la presentación de las soluciones para cada caso que establecemos un vínculo de confianza necesario para la realización efectiva y eficiente de nuestro trabajo.</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>Ofrecemos una amplia variedad de servicios dentales para satisfacer las necesidades específicas de cada paciente. Creemos que el uso de la tecnología puede mejorar la experiencia y los resultados de los tratamientos. Nos dedicamos a proporcionar el más alto nivel de tratamientos de manera oportuna, amigable y cómoda.</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Limpieza profesional de los dientes</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Blanqueamiento dental</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Odontología cosmética (Inlays y Onlays, Carillas de porcelana, Coronas y puentes dentales, Resinas Compuestas)</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Implantes dentales</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Dentaduras Completas (fijas y removibles)</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Dentaduras parciales removibles</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Tratamiento de Ortodoncia</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Endodoncias</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Extracciones dentales</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>– Pequeñas cirugías</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>Este sitio fue diseñado para ayudar a los pacientes a comprender mejor lo que nuestro equipo dental puede brindar y para comprender la importancia de recibir atención dental regular.</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>Siéntase libre en navegar a través del sitio para conocer a los miembros del equipo y ver algunos de los servicios que ofrecemos. (las otras páginas estarán disponibles solo en portugués).</i></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><i>Gracias por visitar nuestro sitio. Esperamos poder atender todas sus necesidades dentales. Si tiene alguna pregunta o desea programar una cita, llame a la oficina al +55 21 2610-3933 o al +55 21 99943-1627.</i></span></p>', 'Quem Somos', '', 'publish', 'closed', 'closed', '', 'quem-somos', '', '', '2020-06-11 00:23:50', '2020-06-11 00:23:50', '', 0, 'http://localhost/_CAQO/clinicathor/?page_id=197', 0, 'page', '', 0);
